import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
    <table>
      <tbody>
          <tr>
              <td width={80} align="center"><Link to="/">Home</Link></td>
              <td width={80} align="center"><Link to="/artistList">Artist</Link></td>
              <td width={80} align="center"><Link to="/add">Add artist</Link></td>
              <td width={80} align="center"><Link to="/login">Login</Link></td>
              <td width={80} align="center"><Link to="/logout">Logout</Link></td>
          </tr>
        </tbody>
    </table>


      <Outlet />
    </>
  )
};

export default Layout;
